//TABLA PARA REPORTES DE USUARIOS
$('.tablaDataUsuario').DataTable({
    dom: 'B<"float-left"i><"float-right"f>t<"float-left"l><"float-right"p><"clearfix">',
    buttons: [{
            extend: 'excelHtml5',
            download: 'open',
            text: '<i class="fas fa-file-excel"> Excel</i> ',
            titleAttr: 'Exportar a Excel',
            className: 'btn btn-success',
            exportOptions: {
                columns: ":not(.no-exportar)" //exportar toda columna que no tenga la clase no-exportar
            }
        },
        {
            extend: 'pdf',
            download: 'open',
            orientation: 'landscape',
            text: '<i class="fas fa-file-pdf"> PDF</i> ',
            title: "Reporte de Usuarios",
            titleAttr: 'Exportar a PDF',
            alignment: 'center',
            className: 'btn btn-danger',
            customize: function(doc) {
                doc.content[1].table.widths = ['7%', '15%', '30%', '10%', '9%','29%'];
                doc.watermark = {
                    text: 'FC Contadores & Asociados',
                    bold: true,
                    color: 'gray',
                    opacity: 0.2
                }
                doc.styles.title = {
                    color: '#0730A3',
                    fontSize: '25',
                    bold: true,
                    alignment: 'center'
                }
                doc.styles.tableHeader = {
                alignment: 'center',
                fontSize: '12',
                bold: true,
                color: '#223D8A'
                }
                doc.content[1].layout = {
                hLineWidth: function(i, node) {
                    return (i === 0 || i === 1) ? 1 : 0;},
                vLineWidth: function(i, node) {
                    return (i === 0 || i === node.table.widths.length) ? 0 : 0;},
                hLineColor: function(i, node) {
                    return (i === 0 || i === 1) ? 'black' : 'gray';},
                };

                doc.content.splice(1, 0, {
                    margin: [10, 15, -2, 10],
                    alignment: 'right',
                    bold: true,
                    text: 'Fecha de Creacion: ' + new Date().toLocaleString(),
                });

                doc.content.splice(1, 0, {
                    margin: [0, 0, 0, -27],
                    alignment: 'left',
                    color: '#7D7631',
                    bold: true,
                    text: 'Elaborado por: ' + $("#username").text(),
                });

                
                doc.styles.tableBodyEven.alignment = 'center';
                doc.styles.tableBodyEven.noWrap = true;
                doc.styles.tableBodyOdd.alignment = 'center';
                doc.styles.tableBodyOdd.noWrap = true;
                doc.styles.tableBodyOdd.fontSize = '10';
                doc.styles.tableBodyEven.fontSize = '10';
                doc.content.splice(0, 0, {
                        columns: [{
                        image: 'data:image/png;base64,',
                        width: 150,
                        opacity: 0.9
                      }]
                  });
            },
            exportOptions: {
                columns: ":not(.no-exportar)" //exportar toda columna que no tenga la clase no-exportar
            },
        },
        {
            extend: 'csv',
            text: '<i class="fa fa-print"> CSV</i> ',
            titleAttr: 'Exportar a CSV',
            className: 'btn btn-info',
            exportOptions: {
                columns: ":not(.no-exportar)" //exportar toda columna que no tenga la clase no-exportar
            }
        },
    ],
    'autoWidth': false,
    'language': language,
});

